// Graphs.js
import React from 'react';
import './Graphs.css';

const Graphs = () => {
  return (
    <div className="graphs">
      <div className="large-graph">Graph</div>
      <div className="small-graphs">
        <div className="small-graph">Graph</div>
        <div className="small-graph">Graph</div>
      </div>
    </div>
  );
};

export default Graphs;
